AR15 7.5" PISTOL Upper NEW NEVER FIRED ---- Stainless Steel Wylde Barrel in Black Nitride ----7075 FORGED ALUMINUM HARD ANODIZEDPISTOL LENGTH GAS SYSTEM LOW PROFILE STEEL GAS BLOCK AND SS GAS TUBE7.5 " BARREL (SS BARREL WITH BLACK NITRIDE COATING) .223 Wylde Chamber (the best)7" KEYMOD HANDGUARD CLAMP ON STYLE KRINK KAN MUZZLE BREAK - SOUND FORWARD DEVICE (OR REMOVE CONE FOR FIRE BALL MODE)PICATINNY RAIL MAGPUL AVG2 ANGLED HAND GRIPAMBIDEXTROUS CHARGING HANDLEABOUT THE 223 WYLDE CHAMBER; 
The .223 Wylde is a hybrid .223/.556 chamber designed by Bill Wylde to yield the accuracy advantages of the match .223 Remington commercial chambering but without the pressure or reliability failures when using high velocity 5.56 NATO spec ammunition. The .223 Wylde achieves better accuracy by having a chamber throat that is tighter than 5.56, but will still function reliably with military 5.56 ammunition because case dimensions are the same. These facts lead to the .223 Wylde having SUPERIOR target and varmint accuracy, a compatibility with all .223 and 5.56 NATO ammunition and being a top choice for competition shootrs. (Wilson Combat 2017)
